import React, {Component} from 'react';

class Choice extends Component{

    constructor(props){
        super(props);
        this.fname = "./static/choices/" + props.cname;
    }

    options = [
        "選択肢1",
        "選択肢2",
        "選択肢3"
    ];

    render(){
        return (
            <div className="options">
                <label>
                    <input type="radio" name="test" /><span>{this.options[0]}</span>
                </label>
                <label>
                    <input type="radio" name="test" /><span>{this.options[1]}</span>
                </label>
                <label>
                    <input type="radio" name="test" /><span>{this.options[2]}</span>
                </label>
            </div>
        );
    }
}
export default Choice;
